import { Link } from "react-router-dom";

import usuarios from "../Pruebas/usuarios.json";

import Datatable from "react-data-table-component"


function GestionUsuarios() {

 const columnas = [
  { 
    name: "CÓDIGO",
    selector: "id",
    sortable: true

  },
  { 
    name: "P. NOMBRE",
    selector: "pNombre",
    sortable: true

  },
  { 
    name: "S. NOMBRE",
    selector: "sNombre",
    sortable: true

  },
  { 
    name: "P. APELLIDO",
    selector: "pApellido",
    sortable: true

  },
  { 
    name: "S. APELLIDO",
    selector: "sApellido",
    sortable: true

  },
  { 
    name: "CÉDULA",
    selector: "cedula",
    sortable: true

  },
  { 
    name: "CORREO",
    selector: "correo",
    sortable: true

  },{ 
    name: "F. DE CREACIÓN",
    selector: "fCreacion",
    sortable: true

  },
  { 
    name: "ÚLTIMO ACCESO",
    selector: "fAcceso",
    sortable: true

  }
 ]

 const paginationComponentOptions = {
  rowsPerPageText: 'Filas por página',
  rangeSeparatorText: 'de',
  selectAllRowsItem: true,
  selectAllRowsItemText: 'Todos',
};

  return (
    <div className="mx-auto ">
      <Datatable
      columns ={columnas}
      data = {usuarios}
      title = "USUARIOS EN EL SISTEMA"
      pagination
      paginationComponentOptions={paginationComponentOptions}
      striped
      highlightOnHover
      noDataComponent
      />
    </div>
  );
}

export default GestionUsuarios;
